import React from 'react';
import { Container } from 'react-bootstrap';
import { VerticalTimeline, VerticalTimelineElement } from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';

export const Internship = () => {
    return (
        <Container>
            <div className='mt-4 d-flex justify-content-center'><h1>History</h1></div>
            <div className='my-4'>

                <VerticalTimeline lineColor={"black"}>
                    <VerticalTimelineElement
                        className="vertical-timeline-element--work"
                        contentStyle={{ background: 'rgb(33, 150, 243)', color: '#fff' }}
                        contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
                        // contentStyle={{ borderTop: "3px solid  rgb(33, 150, 243)" }}
                        date="2011 - present"
                        iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                    //    icon={<WorkIcon />}
                    >
                        <h3 className="vertical-timeline-element-title text-dark">
                            Creative Director
                        </h3>
                        <h4 className="vertical-timeline-element-subtitle text-dark">Miami, FL</h4>
                        <p className='style="color: #333'>
                            Creative Direction, User Experience, Visual Design, Project
                            Management, Team Leading
                        </p>
                    </VerticalTimelineElement>
                    <VerticalTimelineElement
                        className="vertical-timeline-element--work"
                        date="2010 - 2011"
                        contentStyle={{ background: 'rgb(33, 150, 243)', color: '#fff' }}
                        contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
                        iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                    //    icon={<WorkIcon />}
                    >
                        <h3 className="vertical-timeline-element-title text-dark">Art Director</h3>
                        <h4 className="vertical-timeline-element-subtitle text-dark">
                            San Francisco, CA
                        </h4>
                        <p>
                            Creative Direction, User Experience, Visual Design, SEO, Online
                            Marketing
                        </p>
                    </VerticalTimelineElement>
                    <VerticalTimelineElement
                        className="vertical-timeline-element--work"
                        date="2008 - 2010"
                        contentStyle={{ background: 'rgb(33, 150, 243)', color: '#fff' }}
                        contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
                        iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                    //    icon={<WorkIcon />}
                    >
                        <h3 className="vertical-timeline-element-title text-dark">Web Designer</h3>
                        <h4 className="vertical-timeline-element-subtitle text-dark">
                            Los Angeles, CA
                        </h4>
                        <p>User Experience, Visual Design</p>
                    </VerticalTimelineElement>
                    <VerticalTimelineElement
                        className="vertical-timeline-element--work"
                        date="2006 - 2008"
                        contentStyle={{ background: ' #a8d8b9', color: '#fff' }}
                        contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
                        iconStyle={{ background: " #ff5722", color: "#fff" }}
                    //    icon={<WorkIcon />}
                    >
                        <h3 className="vertical-timeline-element-title text-dark">Web Designer</h3>
                        <h4 className="vertical-timeline-element-subtitle text-dark">
                            San Francisco, CA
                        </h4>
                        <p>User Experience, Visual Design</p>
                    </VerticalTimelineElement>

                    <VerticalTimelineElement
                        iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                    //    icon={<StarIcon />}
                    />
                </VerticalTimeline>
            </div>
        </Container>
    );
}
